import React from "react";
import "./App.css";
import Header from "./components/Header";
import Navbar from "./components/Navbar";
import NavSocials from "./components/NavSocials";
import MainBack from "./components/Mainback";

const App = () => {
  return (
    <div className="App">
      <Header />
      <Navbar />
      <NavSocials />
      <MainBack />
    </div>
  );
};

export default App;
